jQuery.fn.setAllToMaxHeight = function(){
	return this.height( Math.max.apply(this, jQuery.map( this , function(e){ return jQuery(e).height() }) ) );
}

if (true) {
  slideDuration = 7000;
} else {
    slideDuration = 0;
}


// preload images
$.fn.preload = function() {
    this.each(function(){
        $('<img/>')[0].src = this;
    });
}


var showSidebar = function() {
	$('body').toggleClass("active-nav");
	$('.menu-button').removeClass("active-button");					
}


var doResize = function(){
  $('ul.collection-th a.prod-th').removeAttr("style").setAllToMaxHeight();
}



//ipad refresh on rotate
if (window.addEventListener) {
    window.addEventListener("orientationchange", function() {
        window.location.reload();
    }, false);
}


// add/remove classes everytime the window resize event fires
jQuery(window).resize(function(){
	var off_canvas_nav_display = $('.off-canvas-navigation').css('display');
	var menu_button_display = $('.menu-button').css('display');
	if (off_canvas_nav_display === 'block') {			
		$("body").removeClass("two-column").addClass("small-screen");				
	} 
	if (off_canvas_nav_display === 'none') {
		$("body").removeClass("active-sidebar active-nav small-screen")
			.addClass("two-column");			
	}	
    doResize();
});	


$(window).load(function() {
   doResize();
});







jQuery(document).ready(function($) {
   $("#main").fitVids();   
  

   // Toggle for nav menu
   $('.menu-button').click(function(e) {
      e.preventDefault();
      showSidebar();							
   });	
    

   $( "#side-menu" ).accordion({
      heightStyle: "content",
      collapsible:true,
      header: "h3.has-sub",
      active:false
   });
   
   $(window).scroll(function(){
      if ($(this).scrollTop() > 200) {
         $('#scroll-top').fadeIn();
      } else {
         $('#scroll-top').fadeOut();
      }
   });    
  
   $(".coll-tags").removeClass('show-tags');
   $(".coll-tags .button").on('click',function(e){
     e.preventDefault();
     //$(this).parent().toggleClass('show-tags');
	 $(".tags").slideToggle(300);
   });
  

  
  
   // Animate the scroll to top
   $('#scroll-top').on('click', function(event) {
      event.preventDefault();
      $('html, body').animate({scrollTop: 0}, 300);
   });       
  
   var $slides = $('#slides');
  
  	if($slides.find("div").length === 1){
      $slides.parent().addClass('single-slide');
   }

   $slides.before("<div class='slide-prev'></div><div class='slide-next'></div>");
   $slides.after("<div class='slide-pager'></div>");

   $slides.find('img').each(function(){
      $('#slideshow .slide-pager').append("<a href='#'></a>");
   });

   $slides.on( 'cycle-initialized', function(event, optionHash) {
      //not needed
   });	


   $slides.on( 'cycle-update-view', function( e, opts ) {
      // show captions
      var currSlide = $(this);
      currSlide.find('.caption1').addClass('animate1');
      currSlide.find('.caption2').addClass('animate2');		
      currSlide.find('.cta').addClass('animate2');		
   });	

   $slides.on( 'cycle-before', function( e, opts ) {
      // hide captions
      var slideshow = $(this);
      var img = slideshow.find('.caption').removeClass('animate1').removeClass('animate2');
   });		
	
   $slides.cycle({
      timeout: slideDuration,
      fx: 'scrollHorz',     
      slides: '.slide',
      prev: '.slide-prev',
      next: '.slide-next',
      pager: '#slideshow .slide-pager',
      //swipe: true,
      speed: 700,
     easing: 'easeOutQuint',
      pagerTemplate: ''
   });    
  
  
   $('select#blog-cats').on('change', function() {
      window.location = $(this).val();
   });  

   // Gallery for product with single image
   $('#product-images.single-image #product-shot').magnificPopup({
      type: 'image'
   });

   // Gallery for product with multiple images
   var prdImages = [];
   var $prdImg = $('#more-images a');
   $prdImg.each(function(){
      prdImages.push({
      src: $(this).prop('href'),
      title: $(this).find('img').prop('alt')
      });  
   });

   $('#product-images.multi-image #product-shot').on('click',function(e){
      // show lightbox popup for all images 
      e.preventDefault();  
      $.magnificPopup.open({
         items: prdImages,
         type: 'image',
         gallery:{
            enabled:true
         }
      });  
   });  
  
   
   // preload gallery images  
   var galleryImg = [];
   // Select all images used in the image swap function - in our case class "img-swap"
   $("#more-images a").each(function(){
      imgUrl = $(this).prop("href");
      galleryImg.push(imgUrl);
   });
   // Pass the array to our preload function
   $(galleryImg).preload();  
  
  
   $("#more-images a").on('click',function(e){
      // swap main image when a thumb is clicked
      e.preventDefault();   
      var href = $(this).prop('href');
      $("#more-images a").removeClass('active-img');
      $(this).addClass('active-img');
      $('#product-shot').find('img').prop('src',href);
   });    
  
  
   
      $('a#product-shot').zoom({url: $(this).prop("href")});
     
  
   
   var owl = $("#more-images");
   owl.owlCarousel({
      itemsCustom : [
      [0, 1],
      [320, 2],   
      [640, 3]
      ],  
      items : 3,
      rewindSpeed : 400,   
      navigation:true,
      navigationText : ["<span class='arrow-left'></span>","<span class='arrow-right'></span>"]   
   });

    
   $('.gt-accordion h4').each(function() {
      var tis = $(this), state = false, answer = tis.next('div').slideUp();
      tis.click(function() {
         state = !state;
         answer.slideToggle(state);
         tis.toggleClass('active',state);
      });
   });     
    
   
      $('input[name="checkout"], input[name="goto_pp"], input[name="goto_gc"]').on('click',function(e) {
         if($('#agree').is(':checked')){
            $(this).submit();
         }
         else{
            alert("You must agree with the terms and conditions of sale to check out");
            $('#agree-terms').addClass('highlight').focus();
            e.preventDefault();
         }
      });    
      
   
   var $brands = $('#brand-scroller');
   $brands.owlCarousel({
      lazyLoad: true,
      itemsCustom: [ [0, 1], [320, 2], [480, 3], [960, 4] ],
      responsiveRefreshRate: 50,
      slideSpeed: 200,
      paginationSpeed: 500,
      autoPlay: 5000,
      stopOnHover: true,
      rewindNav: true,
      rewindSpeed: 500,
      pagination: false,
      navigation: true,
      navigationText : ["<span class='arrow-left'></span>","<span class='arrow-right'></span>"]        
   }); //end: owl   
   
   
   $('a.go-back').on('click', function(e) {
      e.preventDefault();
      javascript:history.back();
   });    
   
   
   // product variant callback  
   var currencyFormat = $('body').data('curr-format');  
   selectCallback = function(variant, selector) {
      var $product = $('#prod-' + selector.product.id);
      $('.var-msg', $product).html('').hide();
      if (variant && variant.available == true) {
         // enable buy button
         $('.purchase', $product).removeClass('disabled').removeAttr('disabled');
         // Update the price and compare at price.
         $('.product-price', $product).html(Shopify.formatMoney(variant.price, currencyFormat));          
         if ( variant.compare_at_price > variant.price ) {
            $('.product-compare-price', $product).html(Shopify.formatMoney(variant.compare_at_price, currencyFormat));
         } else {
            $('.product-compare-price', $product).html('');
         }
      } else {
         var msg = variant ? "Sold Out" : "Out of Stock";    
         $('.product-price', $product).html('');
         $('.product-compare-price', $product).html('');
         $('.var-msg', $product).html(msg).fadeIn(200);
         $('.purchase', $product).addClass('disabled').attr('disabled', 'disabled');
      }
     
     
        Currency.convertAll($('body').data('shop-currency'), $('#currencies').val()); 
     
     
   };         
   
         
      
});


















